  color: inherit;
  border: 2px solid #6f5270;
  border-radius: 10px;
  width: 92.5%;
  padding: 0.5rem 0;
}

footer {
  background-color: white;
  width: 100%;
}

.footer-socials {
  display: flex;
  align-items: center;
  flex-direction: column;
  margin-bottom: 1.5rem;
